import React, { Component } from 'react'
import Header from './Header';

export default class MainSlide extends Component {
  render() {
    return (
      <div className="main-slide">
        <Header />
        <div className="main-title text-center">How to Book an Apartment</div>
      </div>
    )
  }
}
